class Solution:
    def maxOperations(self, s: str) -> int:
        a=[0]
        for x in s:
            if x=='1':
                a[-1]+=1
            elif a[-1]:
                a.append(0)
        a.pop()
        for i in range(1,len(a)):
            a[i]+=a[i-1]
        return sum(a)
